import React, { useState } from "react";



function App() {
    const [name,setname] = useState("");
    const [heading,setheading] = useState("");

    function strikechange(event){
        const newname = event.target.value;
        setname(newname);

    }

    function getnewname(){
        setheading(name);
    }

    return (
        <div>
        <h1>hello {heading}</h1>
        <input onChange={strikechange} type="text" placeholder="Enter your text"/>
        <button onClick={getnewname}>Change Strike</button>
           
            
        </div>



    )
}
export default App;
